function _findIndex(array, fn) {
     for (let i = 0; i < array.length; i++) {
       if (fn(array[i])) {
         return i;
       }
     }
     return -1;
   }

   // data-first
   function findIndex<T>(array: T[], fn: (item: T) => boolean): number;

   // data-last
   function findIndex<T>(fn: (item: T) => boolean): (array: T[]) => number;

   function findIndex() {
     return R.purry(_findIndex, arguments);
   }

